func init() {
	ginkgo.WalkTests(func(name, parentName string, node types.TestNode) {
		combined := name
		if len(parentName) > 0 {
			combined = parentName + " " + combined
		}
		if updated, ok := annotations[combined]; ok {
			node.SetText(updated)
		} else {
			panic(fmt.Sprintf("unable to find test %s", combined))
		}
	})
}
